import React, { useState } from 'react'
import '../../Style/CompanyManage.css'
import SearchItem from '../SearchPage/SearchItem'

function CompanyManage() {
    const[buttonStatus, setButtonStatus] = useState(true)
    function handelClick() {
        setButtonStatus(!buttonStatus)
    }
    return (
        <div className='companymanage-container'>
            <div className='companymanage-title'>
                {buttonStatus?
                (
                <button className='companymanage-button'>Work List</button>
                ):(
                    <button className='companymanage-button-active'>Staff List</button>
                )}
            </div>
            <div>
                <SearchItem/>
                <SearchItem/>
                <SearchItem/>
                <SearchItem/>
            </div>
        </div>
    )
}

export default CompanyManage
